    public static int maxProduct(int[] A) {
        if (A == null || A.length == 0)
            return 0;
        if (A.length == 1)
            return A[0];
        int max_local = A[0];
        int min_local = A[0];
        int global = A[0];
        for (int i = 1; i < A.length; i++) {
            int max_copy = max_local;
            max_local = Math.max(Math.max(A[i] * max_local, A[i]), A[i] * min_local);
            min_local = Math.min(Math.min(A[i] * max_copy, A[i]), A[i] * min_local);
            global = Math.max(global, max_local);
        }
        return global;
    }

    public static int maxProduct1(int[] A) {
        int N = A.length;
        if (N == 1)
            return A[0];

        int count = 0;

        int m = 0, n = N - 1;
        while (m < N && (A[m] == 1 || A[m] == -1)) {

            if (A[m] == -1)
                count++;

            m++;

        }

        while (n > m && (A[n] == 1 || A[n] == -1)) {


            if (A[n] == -1)
                count++;

            n--;

        }

        if (n <= m) {
            return 1;
        }


        int max = A[m];
        N = n - m + 1;
        int[][] c = new int[N][N];


        for (int i = 0; i < N; i++) {
            for (int j = i; j < N; j++) {
                if (i == j)
                    c[i][j] = A[i + m];
                else {
                    c[i][j] = c[i][j - 1] * A[j + m];
                }
                if (count > 0) {
                    if (Math.abs(c[i][j]) > Math.abs(max)) {
                        max = Math.abs(c[i][j]);
                    }
                } else {
                    if (c[i][j] > max) {
                        max = c[i][j];
                    }
                }
            }
        }


        return max;

    }

